INSERT INTO `products` VALUES (1,'RC BASE','Optional','Active','1','1,2,4,5,6,7,9',_binary '<p>La garantie RC prend en charge la r&eacute;paration des dommages corporels ou mat&eacute;riels subis par les tiers et r&eacute;sultant&nbsp;: d&rsquo;accident, d&rsquo;incendie ou d&rsquo;explosion caus&eacute;e par le v&eacute;hicule, les accessoires et produits servant &agrave; son utilisation, les objets et substances qu&rsquo;il transporte&nbsp;; -de la chute de ces accessoires, objets, substances ou produits.</p>',NULL,NULL,NULL),(2,'TARIF DOMMAGE OUR TIERCE COMPLETE','Optional','Active','2,3,4','2','',NULL,NULL,NULL),(3,'Responsabilite Civile1','Base','Active','1,5','2',_binary '<h2>La RC prend en charge la r&eacute;paration des dommages corporels ou mat&eacute;riels subis par les tiers et r&eacute;sultant&nbsp;: d&rsquo;accident, d&rsquo;incendie ou d&rsquo;explosion caus&eacute;e par le v&eacute;hicule, les accessoires et produits servant &agrave; son utilisation, les objets et substances qu&rsquo;il transporte, de la chute de ces accessoires, objets, substances ou produits.</h2>','450','650',NULL),(4,'Tierce complete1','Optional','Active','4,6,14','2',_binary '<p>La TIERCE COMPLETE garantit la prise en charge par l&rsquo;assureur des frais de r&eacute;paration des dommages subis par le v&eacute;hicule assur&eacute; par suite d&rsquo;une collision avec un autre v&eacute;hicule, de choc contre un objet fixe ou mobile, de versement sans collision pr&eacute;alable, de chute dans les ravins ou cours d&rsquo;eau. Sont &eacute;galement couverts les accessoires et pi&egrave;ces de rechange dont le catalogue du constructeur pr&eacute;voit la livraison en m&ecirc;me temps que le v&eacute;hicule.</p>',NULL,NULL,NULL),(5,'Tierce collision1','Optional','Active','4,6,14','1,1',_binary '<p>Elle couvre les dommages subis par le v&eacute;hicule assur&eacute;, ainsi que les accessoires et pi&egrave;ces de recharge dont le catalogue du constructeur pr&eacute;voit la livraison en m&ecirc;me temps que le v&eacute;hicule, lorsque ces dommages proviennent&nbsp;:</p>\r\n<ul>\r\n<li>D&rsquo;une collision avec un autre v&eacute;hicule</li>\r\n<li>D&rsquo;un choc avec un corps fixe ou mobile&nbsp;(animal, poteau &eacute;lectrique, mur, etc.)</li>\r\n<li>D&rsquo;un renversement sans collision pr&eacute;alable.</li>\r\n</ul>',NULL,NULL,NULL),(6,'Incendie1','Optional','Active','7','2',_binary '<p>l\'INCENDIE garantit, &agrave; concurrence de la valeur assur&eacute;e, les dommages r&eacute;sultant d&rsquo;incendie frappant le v&eacute;hicule ainsi que les accessoires et pi&egrave;ces de rechange dont le catalogue du constructeur pr&eacute;voit la livraison en m&ecirc;me temps que le v&eacute;hicule.</p>\r\n<p>&nbsp;</p>',NULL,NULL,NULL),(7,'Vol1','Optional','Active','7,8','6',_binary '<p>La garantie vol couvre les dommages r&eacute;sultant&nbsp;:</p>\r\n<ul>\r\n<li>De la disparition ou de la d&eacute;t&eacute;rioration du vehicule a la suite d&rsquo;un vol ou d&rsquo;une tentative de vol&nbsp;;</li>\r\n<li>De la disparition des accessoires et pi&egrave;ces de rechange dont le catalogue du constructeur pr&eacute;voit la livraison en m&ecirc;me temps que le v&eacute;hicule lorsque le vol a &eacute;t&eacute; commis effraction ou escalade des remises et garages avec ou violences corporelles&nbsp;;</li>\r\n<li>Des frais engag&eacute;s avec l&rsquo;accord de l&rsquo;assureur en vue de la r&eacute;cup&eacute;ration du vehicule vol&eacute;.</li>\r\n</ul>',NULL,NULL,NULL),(8,'Bris de Glace','Optional','Active','11','7',_binary '<p>Cette garantie couvre les bris accidentels du pare-brise, des glaces lat&eacute;rales et de la lunette arri&egrave;re du vehicule assur&eacute;, il faut comprendre par glaces lat&eacute;rales les vitres des porti&egrave;res, mais aussi les custodes (partie en verre situ&eacute; juste a l&rsquo;arri&egrave;re du v&eacute;hicule).</p>\r\n<p>Cette garantie ne couvre pas cependant les bris de verre, phares, r&eacute;troviseurs, qui sont couverts dans le cadre de la garantie dommages tous accidents.</p>',NULL,NULL,NULL),(9,'Personnes Transportees','Optional','Active','12,13','8','',NULL,NULL,NULL),(10,'Avance sur Recours','Optional','Active','9,10','9','',NULL,NULL,NULL),(11,'Responsabilite Civile 4','Base','Active','1,5,13','2',_binary '<p>La RC prend en charge la r&eacute;paration des dommages corporels ou mat&eacute;riels subis par les tiers et r&eacute;sultant&nbsp;: d&rsquo;accident, d&rsquo;incendie ou d&rsquo;explosion caus&eacute;e par le v&eacute;hicule, les accessoires et produits servant &agrave; son utilisation, les objets et substances qu&rsquo;il transporte, de la chute de ces accessoires, objets, substances ou produits.</p>',NULL,NULL,NULL),(12,'TierceComplete4','Optional','Active','4,14,15','3',_binary '<p>la TIERCE COMPLETE&nbsp; garantit la prise en charge par l&rsquo;assureur des frais de r&eacute;paration des dommages subis par le v&eacute;hicule assur&eacute; par suite d&rsquo;une collision avec un autre v&eacute;hicule, de choc contre un objet fixe ou mobile, de versement sans collision pr&eacute;alable, de chute dans les ravins ou cours d&rsquo;eau. Sont &eacute;galement couverts les accessoires et pi&egrave;ces de rechange dont le catalogue du constructeur pr&eacute;voit la livraison en m&ecirc;me temps que le v&eacute;hicule.</p>',NULL,NULL,NULL),(13,'TierceCollision4','Optional','Active','14,15,4','3','',NULL,NULL,NULL),(14,'Incendie4','Optional','Active','7','5',_binary '<p>l\'INCENDIE garantit, &agrave; concurrence de la valeur assur&eacute;e, les dommages r&eacute;sultant d&rsquo;incendie frappant le v&eacute;hicule ainsi que les accessoires et pi&egrave;ces de rechange dont le catalogue du constructeur pr&eacute;voit la livraison en m&ecirc;me temps que le v&eacute;hicule.</p>\r\n<p>&nbsp;</p>',NULL,NULL,NULL),(15,'Vol4','Optional','Active','7,16','6','',NULL,NULL,NULL),(16,'Bris Glace4','Optional','Active','11','7','',NULL,NULL,NULL),(17,'Responsabilite Civile2','Base','Ac