INSERT INTO `template_by_user` VALUES (1,'DEVIS OU PROPOSITION',_binary '<div style=\"margin: 0px; width: 100%; padding: 0px;\">\r\n<h5 style=\"text-align: center;\"><strong>&nbsp;PROPOSITION<br /></strong></h5>\r\n<h5 style=\"text-align: center;\">Agence:BranchNameWithKey;&nbsp;Num&eacute;ro Cotation: ${(policy.getQuotation().getQuotationNo())!}&nbsp;</h5>\r\n<h5 style=\"text-align: center;\">Num&eacute;ro Cotation: ${(policy.getQuotation().getQuotationNo())!}&nbsp;</h5>\r\n<h5 style=\"text-align: center;\">Le pr&eacute;sent contrat est r&eacute;gi par le code CIMA ainsi que par les conditions g&eacute;n&eacute;rales ci-jointes et les pr&eacute;sentes conditions particuli&egrave;res.</h5>\r\n<h5 style=\"text-align: center;\">Assur&eacute;(e):&nbsp;${(policy.getQuotation().getCustomer().getCustomerFirstName())!} &nbsp;${(policy.getQuotation().getCustomer().getCustomerSurName())!}&nbsp;&nbsp;Adresse: ${(policy.getQuotation().getCustomer().getCustomerAddress1())!} Tel: ${(policy.getQuotation().getCustomer().getCustomerMobile())!}&nbsp;</h5>\r\n<h5 style=\"text-align: center;\"><span style=\"text-decoration: underline;\">Identification du v&eacute;hicule&nbsp;</span></h5>\r\n<table style=\"height: 27px; margin-left: auto; margin-right: auto;\" width=\"720\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<h5>Immatricule: ${(policy.getQuotation().getRegNo())!} &nbsp;</h5>\r\n</td>\r\n<td>\r\n<h5>&nbsp; Marque: ${(policy.getQuotation().getMake())!}</h5>\r\n</td>\r\n<td style=\"text-align: center;\">\r\n<h5>Chassis:&nbsp;${(policy.getQuotation().getChasisNumber())!}&nbsp;</h5>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h5 style=\"margin: 0px; width: 100%; padding: 0px; text-align: center;\"><strong>GARANTIES ET PRIME</strong></h5>\r\n<div style=\"margin: 0px; width: 100%; padding: 0px; text-align: center;\">\r\n<h5 style=\"text-align: center;\"><strong>BaseProductRiskDiscountFactorPriceDetails</strong></h5>\r\n<h5 style=\"text-align: center;\"><strong>OptionalProductRiskDiscountFactorPriceDetails&nbsp;</strong></h5>\r\n<h5 style=\"text-align: center;\">Net Price: ${(policy.getQuotation().getAllProductTotalNetPrice())!}; Charges: ${(policy.getQuotation().getChargeEmailKey())!}; Gov Tax: ${(policy.getQuotation().getGovtaxEmailKey())!}; Total Price: ${(policy.getGrandTotal())!}&nbsp;</h5>\r\n<h5 style=\"text-align: center;\"><strong>Dispositions</strong> <strong>compl&eacute;mentaires</strong></h5>\r\n<h5 style=\"text-align: center;\">Le Souscripteur D&eacute;clare n&rsquo;avoir &eacute;t&eacute; titulaire d&rsquo;une autre compagnie d&rsquo;aucun contrat couvrant un ou plusieurs des risques &laquo;&nbsp;responsabilit&eacute; civile, dommage, incendies et vol d&eacute;sign&eacute;s aux pr&eacute;sentes conditions particuli&egrave;res et ayant fait l&rsquo;objet d&rsquo;une r&eacute;siliation pour sinistre ou d&rsquo;une demande de rel&egrave;vements de tarif pour risques aggrav&eacute;s (Malus) pendant les 12 mois &eacute;coul&eacute;s ou &agrave; l&rsquo;&eacute;ch&eacute;ance du contrat et que les informations ayant servi de base au pr&eacute;sent contrat sont sinc&egrave;res et, &agrave; sa connaissance, exacte. En cas de fausses d&eacute;clarations il sera fait application des articles 18 et 19 du code CIMA. Reconna&icirc;t avoir re&ccedil;u, en sus des conditions g&eacute;n&eacute;rales de la police d&rsquo;assurance automobile, les pr&eacute;sentes conditions particuli&egrave;res et les clauses relatives aux garanties souscrites, et avoir pris pleine connaissance des dispositions du contrat auxquelles il adh&egrave;re sans restriction ni r&eacute;serves.</h5>\r\n<h5 style=\"text-align: center;\">La prise d&rsquo;effet de la garantie est subordonn&eacute;e au paiement int&eacute;gral de la prime conform&eacute;ment &agrave; l&rsquo;article 13 du code CIMA.</h5>\r\n<h5 style=\"text-align: center;\">Dakar ${(policy.getTodayDate())!}</h5>\r\n<h5 style=\"text-align: center;\">Le souscripteur &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Pour la Compagnie</h5>\r\n</div>\r\n</div>','','Create','2015-10-22 12:37:08','adminUser','Active','2020-09-21 17:35:59'),(2,'CONDITIONS PARTICULIERES',_binary '<div style=\"margin: 0px; width: 100%; padding: 0px;\">\r\n<h5 style=\"text-align: center;\"><strong>&nbsp;CONDITIONS PARTICULIERES</strong></h5>\r\n<h5 style=\"text-align: center;\"><strong>Agence: BranchNameWithKey&nbsp;<br /></strong></h5>\r\n<h5 style=\"text-align: center;\"><strong>Num&eacute;ro Police: ${(policy.getPolicyNo())!}&nbsp;<br /></strong></h5>\r\n<h5 style=\"text-align: center;\">Le pr&eacute;sent contrat est r&eacute;gi par le code CIMA ainsi que par les conditions g&eacute;n&eacute;rales ci-jointes et les pr&eacute;sentes conditions particuli&egrave;res.</h5>\r\n<h5 style=\"text-align: center;\">Assur&eacute;(e):&nbsp;${(policy.getQuotation().getCustomer().getCustomerFirstName())!} &nbsp;${(policy.getQuotation().getCustomer().getCustomerSurName())!}&nbsp;&nbsp;Adresse: ${(policy.getQuotation().getCustomer().getCustomerAddress1())!} Tel: ${(policy.getQuotation().getCustomer().getCustomerMobile())!}&nbsp;</h5>\r\n<h5 style=\"text-align: center;\">Identification du v&eacute;hicule&nbsp;</h5>\r\n<table style=\"height: 41px; margin-left: auto; margin-right: auto;\" width=\"744\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<h5>Immatricule: ${(policy.getQuotation().getRegNo())!}&nbsp;&nbsp;&nbsp;</h5>\r\n</td>\r\n<td>\r\n<h5>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Marque:&nbsp;${(policy.getQuotation().getMake())!}&nbsp;</h5>\r\n</td>\r\n<td style=\"text-align: center;\">\r\n<h5>Chassis: ${(policy.getQuotation().getChasisNumber())!}</h5>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<h5>Mod&egrave;le: ${(policy.getQuotation().getModule())!}&nbsp;&nbsp;</h5>\r\n</td>\r\n<td>\r\n<h5>Ann&eacute;e de Fabrication: ${(policy.getQuotation().getYearOfManufacture())!}</h5>\r\n</td>\r\n<td>\r\n<h5>P&eacute;riode:Du &nbsp;${(policy.getStartDate())!}&nbsp;&nbsp;Au &nbsp;${(policy.getEndDate())!}&nbsp;</h5>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h5 style=\"margin: 0px; width: 100%; padding: 0px; text-align: center;\"><strong>Garanties et primes</strong></h5>\r\n<div style=\"margin: 0px; width: 100%; padding: 0px; text-align: center;\">\r\n<h5 style=\"text-align: center;\">BaseProductRiskDiscountFactorPriceDetails</h5>\r\n<h5 style=\"text-align: center;\"><strong>OptionalProductRiskDiscountFactorPriceDetails&nbsp;</strong></h5>\r\n<h5 style=\"text-align: center;\">Net Price: ${(policy.getQuotation().getAllProductTotalNetPrice())!}; Charges: ${(policy.getQuotation().getChargeEmailKey())!}&nbsp;; Gov Tax: ${(policy.getQuotation().getGovtaxEmailKey())!}&nbsp;;FGA :&nbsp;${(policy.getQuotation().getFgaEmailKey())!}; Total Price:&nbsp; &nbsp;${(policy.getGrandTotal())!}</h5>\r\n<h5 style=\"text-align: center;\"><br /><strong>Dispositions</strong> <strong>compl&eacute;mentaires</strong></h5>\r\n<h5 style=\"text-align: center;\">Le Souscripteur D&eacute;clare n&rsquo;avoir &eacute;t&eacute; titulaire d&rsquo;une autre compagnie d&rsquo;aucun contrat couvrant un ou plusieurs des risques &laquo;&nbsp;responsabilit&eacute; civile, dommage, incendies et vol d&eacute;sign&eacute;s aux pr&eacute;sentes conditions particuli&egrave;res et ayant fait l&rsquo;objet d&rsquo;une r&eacute;siliation pour sinistre ou d&rsquo;une demande de rel&egrave;vements de tarif pour risques aggrav&eacute;s (Malus) pendant les 12 mois &eacute;coul&eacute;s ou &agrave; l&rsquo;&eacute;ch&eacute;ance du contrat et que les informations ayant servi de base au pr&eacute;sent contrat sont sinc&egrave;res et, &agrave; sa connaissance, 