nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D&rsquo;un commun accord entre les parties, il est convenu que &agrave; compter du&nbsp;${(policy.getTodayDate())!}&nbsp; les garanties du pr&eacute;sent contrat de police&nbsp;&nbsp;${(policy.getPolicyNo())!}&nbsp; sont transf&eacute;r&eacute;es sur le v&eacute;hicule pr&eacute;sentant les caract&eacute;ristiques suivantes.</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Marque&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;:&nbsp; &nbsp;&nbsp;${(policy.getQuotation().getMake())!}&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Model:&nbsp; &nbsp;${(policy.getQuotation().getModule())!}&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Chaisis:&nbsp;${(policy.getQuotation().getChasisNumber())!}&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Registration Number:&nbsp; &nbsp;${(policy.getQuotation().getRegNo())!}&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>De ce qui pr&eacute;c&egrave;de, il sera rembours&eacute; &agrave; l&rsquo;assur&eacute; ou celui -ci completera&nbsp; &agrave; la signature du pr&eacute;sent avenant la somme de</p>\r\n<p>D&eacute;compte du remboursement</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total-ht&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ${(policy.getQuotation().getAllProductTotalNetPrice())!}&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Frais&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;${(policy.getQuotation().getChargeEmailKey())!}&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Taxe&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;${(policy.getQuotation().getGovtaxEmailKey())!}&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Refund from existing car:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp; ${(policy.getQuotation().getExistPolicyRefundDue())!}&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total-Ttc&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ${(policy.getGrandTotal())!}&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>Le pr&eacute;sent avenant, tenant lieu de quittance, est fait aux m&ecirc;mes clauses et conditions que la police ci-dessus, &agrave; laquelle il sera</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Fait &agrave; Dakar, le ${(policy.getTodayDate())!} </p>','','Create','2016-01-19 09:17:32','admin','Active','2020-06-03 12:06:47'),(7,'test','','test_Liste des pièces pédagogiques 1_0.pdf','Upload','2016-08-02 11:53:03','admin','Active','2016-08-02 11:53:03'),(8,'AVEVANT DE SUSPENSION',_binary '<p>&nbsp;&nbsp;</p>\r\n<table border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\" bgcolor=\"#007f00\" height=\"70\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"20\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\"><img src=\"images/logo1.png\" alt=\"CNART ASSURANCES\" width=\"250\" height=\"44\" border=\"0\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font: 20px/20px Arial, Helvetica, sans-serif; background: #292929 repeat-x;\" bgcolor=\"#292929\" height=\"20\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font: 3px/3px Arial, Helvetica, sans-serif;\" bgcolor=\"#3f9c35\" height=\"3\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" bgcolor=\"#ffffff\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"20\">\r\n<tbody>\r\n<tr>\r\n<td style=\"border-bottom: #e1e1e1 1px solid; border-left: #f1f1f1 1px solid; font: 10px/16px Arial, Helvetica, sans-serif; color: #191919; border-top: #f1f1f1 1px solid; border-right: #f1f1f1 1px solid; border-radius: 4px;\" align=\"center\" valign=\"top\" bgcolor=\"#ffffff\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font: 26px/32px Arial, Helvetica, sans-serif; color: #191919;\" colspan=\"3\" align=\"left\" valign=\"top\">\r\n<h3 style=\"text-align: center;\">&nbsp;&nbsp; <strong>AVENANT&nbsp;&nbsp; DE&nbsp;&nbsp; SUSPENSION:</strong></h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font: 12px/16px Arial, Helvetica, sans-serif; color: #191919;\" align=\"left\" valign=\"top\">\r\n<h1 style=\"text-align: center;\">&nbsp;&nbsp;&nbsp;</h1>\r\n<h1>&nbsp;</h1>\r\n<h3 style=\"text-align: left;\">&nbsp;BRANCHE:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;BranchNameWithKey&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; POLICE:&nbsp;&nbsp;&nbsp;&nbsp;${(policy.getPolicyNo())!}&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; AVENANT&nbsp;:</h3>\r\n<h3 style=\"text-align: left;\">&nbsp;CATEGORIE :&nbsp; &nbsp;${(policy.getPolicyCategoryName())!}&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; EFFET&nbsp;: &nbsp;${(policy.getStartDate())!}&nbsp;</h3>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<table style=\"height: 68px; width: 658px;\" border=\"10\" width=\"634\">\r\n<tbody>\r\n<tr>\r\n<td><strong>Souscripteur:</strong></td>\r\n<td>${(policy.getQuotation().getCustomer().getCustomerFirstName())!}&nbsp; ${(policy.getQuotation().getCustomer().getCustomerSurName())!}&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Address:</strong></td>\r\n<td>${(policy.getQuotation().getCustomer().getCustomerAddress1())!},&nbsp;${(policy.getQuotation().getCustomer().getCustomerAddress2())!}, ${(policy.getQuotation().getCustomer().getCustomerCity())!},&nbsp;${(policy.getQuotation().getCustomer().getCustomerCountry())!}, ${(policy.getQuotation().getCustomer().getCustomerPostalCode())!}&nbsp;&nbsp; &nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Dossier:</strong></td>\r\n<td>&nbsp;${(policy.getQuotation().getUniqueRefNumber())!}&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>Le souscripteur d&eacute;clare ne plus mettre en circulation, pour une raison autre qu&rsquo;un accident garanti, le v&eacute;hicule ${(policy.getQuotation().getMake())!}, ${(policy.getQuotation().getModule())!},&nbsp;${(policy.getQuotation().getRegNo())!}&nbsp; B faisant l&rsquo;objet de la police sus-d&eacute;sign&eacute;e &agrave; partir du ${(policy.getStartDateOfSuspension())!}&nbsp;</p>\r\n<p>&nbsp; La compagnie lui donne acte de sa d&eacute;claration&nbsp;; en cons&eacute;quence, les effets de ladite police sont suspendus POUR UN AN MAXIMUM &agrave; compter de ladite date en ce qui concerne le(s) risque(s) mentionn&eacute; (s) dans les documents de souscription ( Voir conditions particuli&egrave;res ou avenant de renouvellement). &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;Toutefois, l&rsquo;effet de la police pourra reprendre avant l&rsquo;expiration du d&eacute;lais d&rsquo;un an , sur simple d&eacute;claration du souscripteur constat&eacute;e par avenant .</p>\r\n<p>&nbsp;Le souscripteur b&eacute;n&eacute;ficiera, &agrave; condition que la suspension ne soit pas inf&eacute;rieure &agrave; quatre semaines cons&eacute;cutives et apr&egrave;s d&eacute;duction de toute prime due pour les risques maintenus en vigueur d&rsquo;une prorogation de garantie &eacute;gale aux &frac34; de la p&eacute;riode de suspension.</p>\r\n<p>&nbsp;Si le souscripteur ne mettait ne mettait toujours pas le v&eacute;hicule en circulation avant l&rsquo;expiration du d&eacute;lai d&rsquo;un an, la police sus-&eacute;nonc&eacute;e se trouverait r&eacute;sili&eacute;e de plein droit et sans autre avis, toutes cotisations &eacute;chues restant acquises &agrave; la compagnie.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">Reason: ${(policy.getReasonForSuspension())!}&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<br />\r\n<h2 style=\"text-align: right;\">&nbsp;&nbsp; Fait triple &agrave; Dakar, le&nbsp;${(policy.getTodayDate())!}&nbsp;</h2>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><strong>L&rsquo;ASSURE&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Pour la Compagnie par D&eacute;l&eacute;gation</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n<td style=\"font: 10px/10px Arial, Helvetica, sans-serif; color: #191919;\" align=\"left\" valign=\"top\" width=\"20\">&nbsp;</td>\r\n<td style=\"font: 12px/16px Arial, Helvetica, sans-serif;\" align=\"left\" valign=\"top\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div>&nbsp;</div>\r\n<p>&nbsp;</p>\r\n<div>&nbsp;</div>\r\n<p>&nbsp;</p>\r\n<div>&nbsp;</div>\r\n<p><br /><br /></p>\r\n<div>&nbsp;</div>\r\n<p>&nbsp;</p>\r\n<div>&nbsp;</div>','','Create','2016-10-14 11:33:51','admin','Active','2020-02-09 21:44:28'),(9,'AVENANT DE REMISE EN VIGUEUR',_binary '<p>&nbsp;</p>\r\n<div style=\"margin: 0px; width: 100%; padding: 0px;\">\r\n<table style=\"height: 134px;\" border=\"0\" width=\"204\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\" bgcolor=\"#007f00\" height=\"70\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"20\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\"><img src=\"images/logo1.png\" alt=\"CNART ASSURANCES\" width=\"105\" height=\"60\" border=\"0\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font: 20px/20px Arial, Helvetica, sans-serif; background: #292929 repeat-x;\" bgcolor=\"#292929\" height=\"20\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font: 3px/3px Arial, Helvetica, sans-serif;\" bgcolor=\"#3f9c35\" height=\"3\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" bgcolor=\"#ffffff\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"20\">\r\n<tbody>\r\n<tr>\r\n<td style=\"border-bottom: #e1e1e1 1px solid; border-left: #f1f1f1 1px solid; font: 10px/16px Arial, Helvetica, sans-serif; color: #191919; border-top: #f1f1f1 1px solid; border-right: #f1f1f1 1px solid; border-radius: 4px;\" align=\"center\" valign=\"top\" bgcolor=\"#ffffff\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font: 26px/32px Arial, Helvetica, sans-serif; color: #191919;\" colspan=\"3\" align=\"left\" valign=\"top\">\r\n<h3 style=\"text-align: center;\"><strong>AVENANT&nbsp;&nbsp; DE&nbsp;&nbsp; REMISE EN</strong></h3>\r\n<h3 style=\"text-align: center;\"><strong> VIGUEUR</strong></h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font: 12px/16px Arial, Helvetica, sans-serif; color: #191919;\" align=\"left\" valign=\"top\">\r\n<h5 style=\"text-align: center;\">Agence:&nbsp;BranchNameWithKey&nbsp;</h5>\r\n<table style=\"height: 96px; width: 932px;\" border=\"12\"