 style=\"text-align: center;\"><sub>RESPONSABILITE CIVILE&nbsp; ET GARANTIES OPTIONNELLES<strong><br /></strong></sub></p>\r\n<div style=\"margin: 0px; width: 100%; padding: 0px; text-align: center;\">\r\n<p style=\"text-align: center;\"><sub>BaseProductRiskDiscountFactorPriceDetails&nbsp;</sub></p>\r\n<p style=\"text-align: center;\"><sub><strong>OptionalProductRiskDiscountFactorPriceDetails&nbsp;</strong></sub></p>\r\n<p style=\"text-align: center;\"><strong><sub>Net Price:&nbsp;${(policy.getQuotation().getAllProductTotalNetPrice())!}&nbsp; / Charges:&nbsp;${(policy.getQuotation().getChargeEmailKey())!}&nbsp; / Gov Tax: ${(policy.getRenewalTaxOnCharge())!}&nbsp;/ FGA: ${(policy.getQuotation().getFgaEmailKey())!} / Total Price:&nbsp; &nbsp;${(policy.getGrandTotal())!}</sub></strong></p>\r\n<sub><strong>Dispositions</strong> <strong>compl&eacute;mentaires</strong></sub></div>\r\n<p><sub>Le Souscripteur D&eacute;clare n&rsquo;avoir &eacute;t&eacute; titulaire d&rsquo;une autre compagnie d&rsquo;aucun contrat couvrant un ou plusieurs des risques &laquo;&nbsp;responsabilit&eacute; civile, dommage, incendies et vol d&eacute;sign&eacute;s aux pr&eacute;sentes conditions particuli&egrave;res et ayant fait l&rsquo;objet d&rsquo;une r&eacute;siliation pour sinistre ou d&rsquo;une demande de rel&egrave;vements de tarif pour risques aggrav&eacute;s (Malus) pendant les 12 mois &eacute;coul&eacute;s ou &agrave; l&rsquo;&eacute;ch&eacute;ance du contrat et que les informations ayant servi de base au pr&eacute;sent contrat sont sinc&egrave;res et, &agrave; sa connaissance, exacte. En cas de fausses d&eacute;clarations il sera fait application des articles 18 et 19 du code CIMA. Reconna&icirc;t avoir re&ccedil;u, en sus des conditions g&eacute;n&eacute;rales de la police d&rsquo;assurance automobile, les pr&eacute;sentes conditions particuli&egrave;res et les clauses relatives aux garanties souscrites, et avoir pris pleine connaissance des dispositions du contrat auxquelles il adh&egrave;re sans restriction ni r&eacute;serves.</sub><sub>La prise d&rsquo;effet de la garantie est subordonn&eacute;e au paiement int&eacute;gral de la prime conform&eacute;ment &agrave; l&rsquo;article 13 du code CIMA.</sub></p>\r\n<p style=\"text-align: center;\"><sub>Dakar ${(policy.getTodayDate())!}</sub></p>\r\n<p style=\"text-align: center;\"><strong><sub>Le souscripteur &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Pour la Compagnie</sub></strong></p>','','Create','2019-07-29 15:49:40','seck','Active','2020-12-24 12:13:49'),(17,'CONTRAT FLOTTE',_binary '<p>SXHDFG</p>','','Create','2019-12-17 21:13:04','admin','Active','2020-04-21 10:35:19'),(18,'FACTURE',_binary '<p style=\"text-align: right;\">Le ${(policy.getTodayDate())!}&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>FACTURE N&deg;&nbsp;${(policy.getQuotation().getUniqueRefNumber())!}&nbsp;</strong></p>\r\n<p style=\"text-align: center;\"><strong>NUMERO POLICE ${(policy.getPolicyNo())!}&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong><strong>&nbsp;</strong></p>\r\n<p><strong>Assur&eacute;</strong>&nbsp;:&nbsp;&nbsp;&nbsp;${(policy.getQuotation().getCustomer().getCompanyName())!}&nbsp;${(policy.getQuotation().getCustomer().getCustomerFirstName())!}&nbsp;${(policy.getQuotation().getCustomer().getCustomerSurName())!}&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ${(policy.getQuotation().get