INSERT INTO `template_file` VALUES (1,'Default Terms And Conditions',_binary '<div><div><div><div><div><div><h1>Car Insurance</h1><div><div><div>To provide you with our best quote we search for great car insurance prices from our panel of leading UK insurers.</div><div><div><p>As well as providing you with a competitive price, we want to share with you some of the products features and benefits:</p><ul><li>Courtesy car on comprehensive policies subject to availability, whilst your own car is being repaired following an accident</li><li>European cover, which will cover you when you travel to a country within the European Union, Norway, Switzerland or Liechtenstein</li><li>No Claims Discount protection available</li><li>UK based specialist call centre</li><li>Monthly payment options (subject to status)</li></ul></div><div><p>You can tailor your policy to suit your needs even further with optional additional cover options:</p><ul><li>3 levels of AXA breakdown cover</li><li>Motor Legal Protection cover of up to ??100,000</li><li>Personal Accident insurance and auto extra/road rage cover</li><li>Substitute Vehicle</li><li>Windows and Windscreen insurance</li></ul></div></div><div>If you prefer to speak to a specialist insurance operative, you can call us on <strong>0800 048 3034</strong> for a competitive, tailored quote. Our phone lines are open Monday to Friday: 8am to 9pm, Saturday: 9am to 5.30pm and Sunday: 10am to 5pm. </div></div></div></div></div></div></div></div></div>'),(2,'Quotation Mail',_binary '<p>&nbsp;</p>\r\n<p>CNART ASSURANCES</p>\r\n<p>&nbsp;</p>\r\n<p>Cher (e) Pr&eacute;noms: ${(sessionQuotation.getCustomer().getCustomerFirstName())!}&nbsp; Nom de Famille: ${(sessionQuotation.getCustomer().getCustomerSurName())!}&nbsp;</p>\r\n<p>&nbsp;Merci de trouver en attache les d&eacute;tails de votre cotation. &nbsp;Nous sommes a votre disposition pour toute question compl&eacute;mentaire</p>\r\n<p>&nbsp;Nous nous r&eacute;jouissons de vous accueillir en tant que client.</p>\r\n<p>&nbsp; Marque :&nbsp;${(sessionQuotation.getMake())!} &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Modele : &nbsp;${(sessionQuotation.getModule())!} &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Immat :&nbsp;${(sessionQuotation.getRegNo())!}&nbsp;</p>\r\n<p>&nbsp;Cordialement,</p>\r\n<p>&nbsp;Votre Assureur CNART!</p>\r\n<p>33 831 06 06</p>'),(3,'Policy Mail',_binary '<div style=\"margin: 0px; width: 100%; padding: 0px;\">\r\n<table border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\" bgcolor=\"#007f00\" height=\"70\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"20\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\"><img src=\"images/logo1.png\" alt=\"CNART ASSURANCES\" width=\"250\" height=\"44\" border=\"0\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font: 20px/20px Arial, Helvetica, sans-serif; background: #292929 repeat-x;\" bgcolor=\"#292929\" height=\"20\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font: 3px/3px Arial, Helvetica, sans-serif;\" bgcolor=\"#3f9c35\" height=\"3\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" bgcolor=\"#ffffff\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"20\">\r\n<tbody>\r\n<tr>\r\n<td style=\"border-bottom: #e1e1e1 1px solid; border-left: #f1f1f1 1px solid; font: 10px/16px Arial, Helvetica, sans-serif; color: #191919; border-top: #f1f1f1 1px solid; border-right: #f1f1f1 1px solid; border-radius: 4px;\" align=\"center\" valign=\"top\" bgcolor=\"#ffffff\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font: 26px/32px Arial, Helvetica, sans-serif; color: #191919;\" colspan=\"3\" align=\"left\" valign=\"top\">\r\n<h1 style=\"margin-top: 0px; font: bold 26px/32px Arial, Helvetica, sans-serif; margin-bottom: 1em; color: #191919;\"><font color=\"#ff0000\"><font color=\"#000000\">Ma